DROP VIEW IF EXISTS `drs`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `drs` AS select `dailyrate`.`ddate` AS `ddate`,`dailyrate`.`rmType` AS `rmType`,`dailyrate`.`rateType` AS `rateType`,`dailyrate`.`rate` AS `rate`,`dailyrate`.`refRule` AS `refRule`,`ratetype`.`prepaid` AS `prepaid`,`ratetype`.`freeCancelDate` AS `freeCancelDate`,`ratetype`.`isToAll` AS `isToAll`,`roomtype`.`num` AS `num`,`roomtype`.`bed` AS `bed`,`dailystatus`.`sold` AS `sold`,`dailystatus`.`other` AS `other`,`roomtype`.`tier` AS `tier`,((`roomtype`.`num` - `dailystatus`.`sold`) - `dailystatus`.`other`) AS `rest` from (((`dailyrate` left join `ratetype` on((`dailyrate`.`rateType` = `ratetype`.`code`))) left join `roomtype` on((`dailyrate`.`rmType` = `roomtype`.`code`))) left join `dailystatus` on((`dailyrate`.`ddate` = `dailystatus`.`ddate`))) where (`dailyrate`.`rmType` = `dailystatus`.`rmType`) order by `roomtype`.`tier`,`roomtype`.`bed`,`ratetype`.`prepaid` desc,`dailyrate`.`rmType`,`dailyrate`.`ddate`;

-- ----------------------------
-- View structure for ds
-- ----------------------------
DROP VIEW IF EXISTS `ds`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ds` AS select `dailystatus`.`ddate` AS `ddate`,`dailystatus`.`rmType` AS `rmType`,`dailystatus`.`sold` AS `sold`,`dailystatus`.`other` AS `other`,`roomtype`.`num` AS `num`,((`roomtype`.`num` - `dailystatus`.`sold`) - `dailystatus`.`other`) AS `rest` from (`dailystatus` left join `roomtype` on((`dailystatus`.`rmType` = `roomtype`.`code`))) order by `dailystatus`.`ddate`,`dailystatus`.`rmType`;

